// src/pages/instructor/InstructorDashboard.jsx
import React, { useEffect, useState } from "react";
import { useNavigate } from "react-router-dom";
import axios from "axios";

const InstructorDashboard = () => {
  const navigate = useNavigate();
  const [instructorName, setInstructorName] = useState("");
  const [stats, setStats] = useState({ lectures: 0, courses: 0 });
  const [courseList, setCourseList] = useState([]);
  const [lectureList, setLectureList] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState("");

  // Fetch instructor info from localStorage
  useEffect(() => {
    const name = localStorage.getItem("instructorName");
    if (name) setInstructorName(name);
    else navigate("/"); // redirect if not logged in
  }, [navigate]);

  // Fetch stats and lists from backend
  useEffect(() => {
    const fetchDashboard = async () => {
      try {
        const token = localStorage.getItem("instructorToken");
        if (!token) {
          navigate("/");
          return;
        }

        const res = await axios.get(
          "http://localhost:5000/api/instructor/dashboard",
          {
            headers: { Authorization: `Bearer ${token}` },
          }
        );

        const data = res.data;
        setStats({ lectures: data.lectures, courses: data.courses });
        setCourseList(data.courseList);
        setLectureList(data.lectureList);
        setLoading(false);
      } catch (err) {
        console.error(err);
        setError("Failed to fetch dashboard data");
        setLoading(false);
      }
    };

    fetchDashboard();
  }, [navigate]);

  // Logout handler
  const handleLogout = () => {
    localStorage.removeItem("instructorToken");
    localStorage.removeItem("instructorName");
    navigate("/");
  };

  return (
    <div className="min-h-screen bg-gray-100">
      {/* NAVBAR */}
      <nav className="bg-blue-600 text-white px-6 py-4 flex justify-between items-center">
        <h1 className="font-bold text-xl">Instructor Dashboard</h1>
        <div className="flex items-center gap-4">
          <span>Welcome, {instructorName}</span>
          <button
            onClick={handleLogout}
            className="bg-white text-blue-600 px-3 py-1 rounded hover:bg-gray-200 transition"
          >
            Logout
          </button>
        </div>
      </nav>

      {/* ERROR MESSAGE */}
      {error && (
        <div className="p-3 m-4 rounded bg-red-200 text-red-800">{error}</div>
      )}

      {/* STATS */}
      <div className="p-6 flex flex-wrap gap-6">
        <div className="bg-white p-4 rounded shadow flex-1 min-w-[150px] text-center">
          <h3 className="text-lg font-medium">Courses</h3>
          <p className="text-2xl font-bold">{stats.courses}</p>
        </div>
        <div className="bg-white p-4 rounded shadow flex-1 min-w-[150px] text-center">
          <h3 className="text-lg font-medium">Lectures</h3>
          <p className="text-2xl font-bold">{stats.lectures}</p>
        </div>
      </div>

      {/* MAIN CONTENT */}
      <div className="p-6 grid grid-cols-1 md:grid-cols-2 gap-6">
        {/* Courses List */}
        <div className="bg-white p-4 rounded shadow">
          <h2 className="text-lg font-semibold mb-3">Assigned Courses</h2>
          {loading ? (
            <p>Loading courses...</p>
          ) : courseList.length === 0 ? (
            <p>No courses assigned</p>
          ) : (
            <ul className="max-h-64 overflow-auto">
              {courseList.map((course) => (
                <li key={course._id} className="border-b p-2">
                  {course.title} - {course.description}
                </li>
              ))}
            </ul>
          )}
        </div>

        {/* Lectures List */}
        <div className="bg-white p-4 rounded shadow">
          <h2 className="text-lg font-semibold mb-3">Assigned Lectures</h2>
          {loading ? (
            <p>Loading lectures...</p>
          ) : lectureList.length === 0 ? (
            <p>No lectures assigned</p>
          ) : (
            <ul className="max-h-64 overflow-auto">
              {lectureList.map((lecture) => (
                <li key={lecture._id} className="border-b p-2">
                  {lecture.title} - Course: {lecture.courseId?.title || "N/A"} -{" "}
                  {new Date(lecture.date).toLocaleDateString()}
                </li>
              ))}
            </ul>
          )}
        </div>
      </div>
    </div>
  );
};

export default InstructorDashboard;
